   // give me a set of parameter, return a set of pole and zshift.
   bool poleClass::getPole ( int inputMethod, int inputPole, double inputBeta,  std::vector< std::complex<double> > &out_zshift, std::vector < std::complex<double> > &out_zweight, std::vector< std::complex<double> > &out_fweight, std::vector < std::complex<double> > &out_eweight  ){
        for ( int i = 0; i < method.size(); i++ ){
            if(inputMethod == method[i] ){
               if(numPole[i] >= inputPole && beta[i] >= inputBeta){
                 if(i < method.size() - 1)
                   if((numPole[i+1] >= inputPole) && (beta[i+1] >= inputBeta)){
                      // assume the numPole and beta are in assending or desending order
                      if( (numPole[i+1] < numPole[i]) || (beta[i+1] < beta[i]))
                          continue;
                   }
//		 std::cout << " Input beta: " <<  inputBeta << "; Pole beta " << beta[i] << " numPole " << numPole[i] << " method "<<  method[i] << std::endl;
                   out_zshift = zshift[i];
                   out_zweight = zweight[i];
                   if( inputMethod != 2) {
                     out_fweight = fweight[i];
                     out_eweight = eweight[i];
                   }
                   return true;
               }
            }
        }
        return false;
   }


